import React, { useState } from 'react';
import './Dashboard.css';  // Import CSS for styling

// Menu component for displaying navigation buttons
const Menu = ({ onSelect }) => {
    return (
        <div className="menu">
            <button onClick={() => onSelect('profile')}>Profile</button>
            <button onClick={() => onSelect('communityFeed')}>Community Feed</button>
            <button onClick={() => onSelect('mapCalendar')}>Map/Calendar</button>
            <button onClick={() => onSelect('safety')}>Safety</button>
            <button onClick={() => onSelect('notebook')}>Notebook</button>
        </div>
    );
};

// Form component for submitting invite codes
const InviteCodeForm = ({ onInviteCodeSubmit }) => {
    const [inviteCode, setInviteCode] = useState('');

    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();
        onInviteCodeSubmit(inviteCode); // Call parent function with invite code
        setInviteCode(''); // Clear invite code input
    };

    return (
        <form onSubmit={handleSubmit}>
            <input
                type="text"
                placeholder="Enter invite code"
                value={inviteCode}
                onChange={(e) => setInviteCode(e.target.value)}
            />
            <button type="submit">Submit</button>
        </form>
    );
};

// Placeholder component for Community Feed content
const CommunityFeed = ({ onInviteCodeSubmit }) => {
    return (
        <div>
            <div>Community Feed Content</div>
            {/* Include other community feed components like NewsFeed here */}
            <InviteCodeForm onInviteCodeSubmit={onInviteCodeSubmit} />
        </div>
    );
};

// Placeholder component for Profile content
const Profile = ({ user }) => {
    return (
        <div className="profile-container">
            <h2>Profile</h2>
            <p><strong>First Name:</strong> {user.firstname}</p>
            <p><strong>Last Name:</strong> {user.lastname}</p>
            <p><strong>Date of Birth:</strong> {user.dob}</p>
            <p><strong>Gender:</strong> {user.gender}</p>
            <p><strong>Role:</strong> {user.role}</p>
            {user.role === 'provider' && user.licenseNumber && (
                <p><strong>License Number:</strong> {user.licenseNumber}</p>
            )}
            {user.role === 'pregnant' && user.weeksPregnant && (
                <p><strong>Weeks Pregnant:</strong> {user.weeksPregnant}</p>
            )}
        </div>
    );
};

// Main layout component for displaying selected content area
const DashboardLayout = ({ user }) => {
    const [selectedSection, setSelectedSection] = useState('communityFeed');

    // Function to handle invite code submission
    const onInviteCodeSubmit = (inviteCode) => {
        // Example logic to find invited user and notify them
        const invitedUser = users.find(user => user.inviteCode === inviteCode);
        if (invitedUser) {
            alert(`${invitedUser.firstname} has been notified of your connection request.`);
            // Additional logic to handle acceptance of connection request
        } else {
            alert('Invalid invite code.');
        }
    };

    // Function to render content based on selected section
    const renderContent = () => {
        switch (selectedSection) {
            case 'profile':
                return <Profile user={user} />;
            case 'communityFeed':
                return <CommunityFeed onInviteCodeSubmit={onInviteCodeSubmit} />;
            case 'mapCalendar':
                return <MapCalendar />; // Placeholder for Map/Calendar component
            case 'safety':
                return <Safety />; // Placeholder for Safety component
            case 'notebook':
                return <Notebook />; // Placeholder for Notebook component
            default:
                return <CommunityFeed onInviteCodeSubmit={onInviteCodeSubmit} />;
        }
    };

    return (
        <div className="dashboard-layout">
            <Menu onSelect={setSelectedSection} /> {/* Render Menu component */}
            <div className="content-area">
                {renderContent()} {/* Render selected content based on state */}
            </div>
        </div>
    );
};

// ProviderDashboard component
const ProviderDashboard = ({ user }) => {
    return <DashboardLayout user={user} />; // Render DashboardLayout with user props
};

// PregnantDashboard component
const PregnantDashboard = ({ user }) => {
    return <DashboardLayout user={user} />; // Render DashboardLayout with user props
};

// Dashboards component to switch between different dashboards
const Dashboards = ({ user }) => {
    switch (user.dashboard) {
        case 'ProviderDashboard':
            return <ProviderDashboard user={user} />;
        case 'PregnantDashboard':
            return <PregnantDashboard user={user} />;
        default:
            return <div>No Dashboard Found</div>; // Default case if no matching dashboard
    }
};

export { ProviderDashboard, PregnantDashboard, Dashboards }; // Export components for use in other files
